import { Injectable } from '@angular/core';
import { Activity } from '../app/activity-list/activity-list.component'; 

@Injectable({
  providedIn: 'root',
})
export class ActivityService {
  private enrolledActivities: Activity[] = [];

  getEnrolledActivities(): Activity[] {
    return this.enrolledActivities;
  }

  enrollInActivity(activity: Activity): void {
    if (!this.enrolledActivities.some(a => a.id === activity.id)) {
      this.enrolledActivities.push(activity);
    }
  }
}
